import {Link} from 'react-router-dom'
import '../style/playlistGeneratorCSS.css'
import {handleLogin} from '../constants/auth'

const PlaylistGenerator = () => {

  const getUsername = (callback) => {
    console.log('getUsername');
    var url = 'https://api.spotify.com/v1/me';
    $.ajax(url, {
      dataType: 'json',
      headers: {
        'Authorization': 'Bearer ' + g_access_token
      },
      success: function(r) {
        console.log('got username response', r);
        callback(r.id);
      },
      error: function(r) {
        callback(null);
      }
    });
  }

  const createPlaylist = (username, name, callback)=> {
    console.log('createPlaylist', username, name);
    var url = 'https://api.spotify.com/v1/users/' + username +
      '/playlists';
    $.ajax(url, {
      method: 'POST',
      data: JSON.stringify({
        'name': name,
        'public': false
      }),
      dataType: 'json',
      headers: {
        'Authorization': 'Bearer ' + g_access_token,
        'Content-Type': 'application/json'
      },
      success: function(r) {
        console.log('create playlist response', r);
        callback(r.id);
      },
      error: function(r) {
        callback(null);
      }
    });
  }

  const addTracksToPlaylist = (username, playlist, tracks, callback) => {
    console.log('addTracksToPlaylist', username, playlist, tracks);
    var url = 'https://api.spotify.com/v1/users/' + username +
      '/playlists/' + playlist +
      '/tracks'; // ?uris='+encodeURIComponent(tracks.join(','));
    $.ajax(url, {
      method: 'POST',
      data: JSON.stringify(tracks),
      dataType: 'text',
      headers: {
        'Authorization': 'Bearer ' + g_access_token,
        'Content-Type': 'application/json'
      },
      success: function(r) {
        console.log('add track response', r);
        callback(r.id);
      },
      error: function(r) {
        callback(null);
      }
    });
  }

  const doit = () => {
    // parse hash
    var hash = location.hash.replace(/#/g, '');
    var fullHash = hash.split('&');
    var args = {};
    fullHash.forEach(function(keyvalue) {
      var idx = keyvalue.indexOf('=');
      var key = keyvalue.substring(0, idx);
      var val = keyvalue.substring(idx + 1);
      args[key] = val;
    });

    playlistName = localStorage.getItem('createplaylist-name');
    playlistTracks = JSON.parse(localStorage.getItem('createplaylist-tracks'));

    console.log('got args', args);

    if (typeof(args['access_token']) != 'undefined') {
      // got access token
      console.log('got access token', args['access_token']);
      g_access_token = args['access_token'];
    }

    getUsername(function(username) {
      console.log('got username', username);
      createPlaylist(username, playlistName, function(playlist) {
        console.log('created playlist', playlist);
        addTracksToPlaylist(username, playlist, playlistTracks, function() {
          console.log('tracks added.');
          $('#playlistlink').attr('href', 'spotify:user:'+username+':playlist:'+playlist);
          $('#creating').hide();
          $('#done').show();
        });
      });
    });
  }
  return(
  <div class="v10_428">
    <div class="v2_2">
      <div class="v3_194">
        <div class="background">
        <button onClick={handleLogin}>
          Connect Playlist to Spotify
          </button>
          <button>
          <Link to="/">back button</Link> 
          </button>
        </div>
        <div class="playlistTitlebox">
          <span class="playlistName">Pop Right Now</span>
          <div class="playlistInfo">
            <span class="playlistLength">100 songs, 5 hr 5 min</span>
            <span class="playlistProgram">Spotify</span>
          </div>
          <span class="playlistPLAYLIST">PLAYLIST</span>
          <div class="playlistImage"></div>
        </div>
        <div class="playlistContainer">
          <div class="v3_271">
            <div class="name"></div>
            <span class="v3_273">#</span>
            <span class="v3_274">TITLE</span>
            <span class="v3_275">ALBUM</span>
            <span class="v3_276">DATE ADDED</span>
            <div class="name"></div>
          </div>
          <div class="v3_460">
            <div class="name"></div>
            <div class="name"></div>
            <div class="name"></div>
            <div class="name"></div>
            <div class="name"></div>
            <div class="name"></div>
            <div class="name"></div>
            <div class="name"></div>
          </div>
        </div>
        <div class="line"></div>
      </div>
    </div>
  </div>
  )
  }

  export default PlaylistGenerator;
